import React from "react";
import "./Styles.css";
import { Swiper, SwiperSlide } from "swiper/react";

const Videoplayer = () => {
    return (
        <div>
            <div className="video-content">Hướng Dẫn Sử Dụng Sản Phẩm</div>
            <Swiper
                navigation={true}
                modules={[Navigation]}
                className="mySwiper"
            ></Swiper>
            <div className="video">
                <video
                    style={{ width: 900, height: 500 }}
                    src="./video.mp4"
                    autoPlay={true}
                    muted={true}
                ></video>
            </div>
        </div>
    );
};

export default Videoplayer;
